import {useEffect, useState} from "react";
import axios from "axios";
import {useNavigate} from "react-router-dom";

export const BestSellers=()=>{
    const [products,setProducts]=useState<any>(null)
    let navigate=useNavigate()

    useEffect(()=>{
        axios.get('https://masterclass.kimitsu.it-incubator.ru/api/products')
            .then((res)=>{
                setProducts(res.data)
            })
    },[])

    // const _products=[
    //     {"_id":"62bde0f941e732c5cfc7897f","id":1,"title":"Mens Casual Premium Slim Fit T-Shirts ","price":22.3,"description":"Slim-fitting style, contrast raglan long sleeve, three-button henley placket, light weight & soft fabric for breathable and comfortable wearing. And Solid stitched shirts with round neck made for durability and a great fit for casual fashion wear and diehard baseball fans. The Henley style round neckline includes a three-button placket.","category":"men's clothing","image":"data:image/jpeg;base64,","rating":{"rate":4.1,"count":259},"createdAt":"2022-06-30T17:44:25.381Z","updatedAt":"2022-06-30T17:44:25.381Z","__v":0},
    //     {"_id":"62bde13f41e732c5cfc78982","id":2,"title":"Mens Cotton Jacket","price":55.99,"description":"great outerwear jackets for Spring/Autumn/Winter, suitable for many occasions, such as working, hiking, camping, mountain/rock climbing, cycling, traveling or other outdoors. Good gift choice for you or your family member. A warm hearted love to Father, husband or son in this thanksgiving or Christmas Day.","category":"men's clothing","image":"data:image/jpeg;base64,","rating":{"rate":4.7,"count":500},"createdAt":"2022-06-30T17:45:35.705Z","updatedAt":"2022-06-30T17:45:35.705Z","__v":0}
    // ]
    const showProductHandler=(id:any)=>{
        navigate(`product/${id}`)
    }


    return (
        <div className={'bestSeller'}>
            <h2>Best sellers</h2>
            <div className={'cards'}>
                    {
                        products===null
                            ? <h1 className={"loading"}>loading</h1>
                        :products.map((el:any)=>{
                            return(
                                <div className={'card'} key={el.id}>
                                    <img src={el.image} alt={'img'}/>
                                    <h4>{el.title}</h4>
                                    <p className={'price'}>${el.price}</p>
                                    <button onClick={()=>showProductHandler(el.id)}>Show more</button>
                                </div>
                            )
                        })
                    }
            </div>
        </div>
    )
}